DROP TABLE if EXISTS lineitem;
CREATE TABLE if NOT EXISTS lineitem (
  l_orderkey BIGINT,
  l_partkey BIGINT,
  l_suppkey BIGINT,
  l_linenumber INT,
  l_quantity DECIMAL(18,2),
  l_extendedprice DECIMAL(18,2),
  l_discount DECIMAL(18,2),
  l_tax DECIMAL(18,2),
  l_returnflag STRING,
  l_linestatus STRING,
  l_shipdate DATE,
  l_commitdate DATE,
  l_receiptdate DATE,
  l_shipinstruct STRING,
  l_shipmode STRING,
  l_comment STRING);

